import React from 'react'


const HistoryList = ({items, setHistory}) => {
    const Delete = (e) => {
        e.preventDefault()

        const requestOptions = {
            method: 'DELETE',
            headers: {
                "Accept": "application/json",
            },
            redirect: 'follow'
        };

        fetch("http://localhost:5555/clearHistory", requestOptions)
            .then(response => response.text())
            .then(result => console.log(result))
            .catch(error => console.log('error', error));
        const requestOptionsH = {
            method: 'GET',
            headers: {
                "Accept": "application/json",
            },
            redirect: 'follow'
        };

        fetch("http://localhost:5555/history", requestOptionsH)
            .then(response => response.json())
            .then(result => setHistory(result.records))
            .catch(error => console.log('error', error));

    }
    return(
        <div>
            <div style={{display:'flex'}}>
                <p>{items.x}</p>
                <p>{items.operation}</p>
                <p>{items.y}</p>
                <p>=</p>
                <p>{items.result}</p>
                <button onClick={Delete}>X</button>
                <button>update</button>
            </div>
        </div>
    )
}
export default HistoryList
